import { CartItem } from "./CartItem";

export function ProductItem({ date,onMove }) {

    return <div className="col-md-6">
        <div className="row">
            <div className="col-md-6">
                <div className="row">
                    {
                        date.map(elm => {
                            return <CartItem
                                key={elm.id}{...elm}
                                onMove
                            />

                        })
                    }
                </div>

            </div>

        </div>
    </div>
}
